import axios from "axios";

const VoteResult = async () => {
  axios({
    method: "GET",
    url: "http://localhost:3001/vote-count",
    responseType: "json",
  }).then((response) => {
    console.log(response);
  });

  return (
    <div className="result-item">
      <span>President</span>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Votes</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>abcd</td>
            <td>abcd</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default VoteResult;
